CREATE TABLE users
(id int NOT NULL AUTO_INCREMENT,
 first_name VARCHAR(50) NOT NULL,
 last_name VARCHAR(50) NOT NULL,
 email VARCHAR(50) NOT NULL,
 profile_picture VARCHAR(100),
 gender VARCHAR(50),
 admin BOOLEAN NOT NULL,
 ip_address VARCHAR(20),
 phone VARCHAR(50),
 age INT,
 last_login DATE,
 is_active BOOLEAN,
 pass VARCHAR(300)
 PRIMARY KEY (id));

